import React, { useEffect } from 'react'

const Logout = () => {

  useEffect(() => {
    fetch("/logout", {
      method : "GET",
      headers : {
        Accept : "application/json",
        "Content-Type" : "application/json"
      },
      credentials : "includes"
    })
  })

  return (
    <div>
        <h1>Logout page</h1>
    </div>
  )
}

export default Logout
